//topbar

import React, {Component} from 'react';
import {Navbar, Nav,} from 'react-bootstrap';

import './Topbar.css'

class Topbar extends Component {
  render() {
    return (
      <div>
      <Navbar bg="light">
    <Navbar.Brand href="#home">Who Needs A Quote!?</Navbar.Brand>
  </Navbar>
      </div>
    )
  }
}

export default Topbar;
